import React from 'react';

export default function Navbar() {
    return (
        <div className="navbar">
            <span className="logo">Auth app</span>
            <ul className="list">
                <li className="listitem">
                    <img src="" alt="" className="avatar" />
                </li>
                <li className="list"></li>
            </ul>
        </div>
    );
}
